function randomString(str, min, max, mode) {
  // 如果这个字符串之前没有出现过，就生成一个新的随机数
  if (!randomString.generatedNumbers) {
    randomString.generatedNumbers = {};
  }
  if (!randomString.generatedNumbers[mode]) {
    randomString.generatedNumbers[mode] = {};
  }
  if (!randomString.generatedNumbers[mode][str]) {
    randomString.generatedNumbers[mode][str] = Math.random() * (max - min) + min;
  }
  // 返回对应的随机数
  return randomString.generatedNumbers[mode][str];
}

